import axios from "axios";
import Joi from "joi";
import React, { useState, useEffect } from "react";
import { useNavigate } from "react-router-dom";
export default function Register() {
  let [isLoding, setIsLoading] = useState(false);
  const navigate = useNavigate();
  const [error, setError] = useState("");
  const [errors, setErrors] = useState([]);
  const [isChecked, setIsChecked] = useState(false);
  const [usernames, setUsernames] = useState([]);

  const [formData, setFormData] = useState({
    userName: "",
    email: "",
    password: "",
    rePassword: "",
    dateOfBirth: "",
  });

  function getUser(e) {
    let data = { ...formData };
    data[e.target.name] = e.target.value;
    setFormData(data);
  }

  useEffect(() => {
    const storedUsernames = JSON.parse(localStorage.getItem("usernames")) || [];
    setUsernames(storedUsernames);
  }, []);

  function submitRegisterForm(e) {
    e.preventDefault();
    if (!isChecked) {
      setError("You must agree to the terms of service");
      return;
    }
    let statusError = validation();
    if (statusError?.error) {
      setErrors(statusError?.error.details);
    } else {
      axios
        .post("http://hawas.runasp.net/api/v1/Register", formData)
        .then((res) => {
          console.log(res.data);
          localStorage.setItem("currentUser", formData.email);
          navigate("/Login");
        })
        .catch((err) => {
          console.log(err);
          setError(err.response?.data?.message || "Registration failed");
        });
    }
  }
  function validation() {
    let schema = Joi.object({
      userName: Joi.string().alphanum().min(3).max(30).required(),
      email: Joi.string()
        .email({
          minDomainSegments: 2,
          tlds: { allow: ["com", "net"] },
        })
        .required(),
      password: Joi.string()
        .min(8)
        .max(30)
        .pattern(
          new RegExp(
            "^(?=.*[a-z])(?=.*[A-Z])(?=.*\\d)(?=.*[@$!%*?&])[A-Za-z\\d@$!%*?&]+$"
          )
        )
        .required()
        .messages({
          "string.base": "Password must be a string",
          "string.empty": "Password cannot be empty",
          "string.min": "Password must be at least {#limit} characters long",
          "string.max":
            "Password must be less than or equal to {#limit} characters",
          "string.pattern.base":
            "Password must contain at least one uppercase letter, one lowercase letter, one number, and one special character",
          "any.required": "Password is required",
        }),

      rePassword: Joi.any().valid(Joi.ref("password")).required().messages({
        "any.only": "Passwords do not match",
      }),
      dateOfBirth: Joi.date().iso().max("2020-12-31").required().messages({
        "date.max": "You must be born before 2021",
      }),
    });
    return schema.validate(formData, { abortEarly: false });
  }

  return (
    <>
      <div className="w-75 mx-auto mt-5">
        <h2 className="text-center mb-4">Register Now</h2>
        {error.map((error, i) => (
          <div key={i} className="alert alert-danger">
            {error.message}
          </div>
        ))}
        <form onSubmit={submitRegisterForm}>
          <label htmlFor="username">user name : </label>
          <input
            onChange={getUser}
            className="form-control mb-4"
            type="text"
            id="username"
            name="username"
          />

          <label htmlFor="email">email : </label>
          <input
            onChange={getUser}
            className="form-control mb-4"
            type="email"
            id="email"
            name="email"
          />

          <label htmlFor="password">password : </label>
          <input
            onChange={getUser}
            className="form-control mb-4"
            type="password"
            id="password"
            name="password"
          />

          <label htmlFor="passwordConfirm">passwordConfirm : </label>
          <input
            onChange={getUser}
            className="form-control mb-4"
            type="password"
            id="passwordConfirm"
            name="passwordConfirm"
          />

          <button type="submit" className="btn btn-outline-info my-2">
            {isLoding ? <i className="fas fa-spinner fa-spin"></i> : "Register"}{" "}
          </button>
        </form>
      </div>
    </>
  );
}
